<template>
  <div style="margin: 30px 0px 0px 30px">
    <div class="dash">
      <font size="4">미리보기</font>
    </div>
    <div class="dash" ref="testHtml" style="height: 620px">
      <el-carousel indicator-position="none" arrow="always" height="580px">
        <el-carousel-item v-for="(chuck, i) in selectedChucks" :key="i">
          <el-card shadow="none" style="border: 0px">
            <img
              :src="chuck.image"
              style="
                object-fit: cover;
                width: 400px;
                height: 300px;
                margin-top: 60px;
              "
            />
            <div style="padding: 20px">
              <font size="5">{{ chuck.title }}</font>
            </div>
            <div v-html="chuck.content"></div>
          </el-card>
        </el-carousel-item>
      </el-carousel>
    </div>
    <div @click="generatePdf" class="dash pointer">
      <font size="4">PDF로 내려받기</font>
    </div>
  </div>
</template>

<script>
import { mapGetters } from "vuex";
import { jsPDF } from "jspdf";
import axios from "axios";
export default {
  data() {
    return {
      checkArr: [],
      selectedMap: new Map(),
      selectedChucks: [],
    };
  },
  computed: {
    ...mapGetters([
      'getFaceDataBook',
      'getPersonArrayBook',
      'getFaceDataStudio',
    ]),
  },
  watch: {
    getFaceDataStudio: function(data) {
      this.checkArr = []
      this.selectedMap = new Map()
      this.selectedChucks = []
      this.$forceUpdate()
    },
    getPersonArrayBook: function (data) {
      this.$forceUpdate()
      let change = [];
      if (this.checkArr.length == 0) {
        this.checkArr = data.slice();
        for (let i = 0; i < data.length; i++) change.push(i);
      } else {
        for (let i = 0; i < data.length; i++) {
          if (this.checkArr[i] != data[i]) change.push(i);
        }
        this.checkArr = data.slice();
      }
      if (change.length != 0) {
        change.forEach((index) => {
          const flag = this.checkArr[index];
          const num = this.getFaceDataBook[index].content_list.length;
          for (let i = 0; i < num; i++) {
            const path = this.getFaceDataBook[index].content_list[i].image;
            const chuck = this.getFaceDataBook[index].content_list[i];
            if (this.selectedMap.has(path)) {
              if (!flag) this.selectedMap.delete(path);
            } else {
              if (flag) this.selectedMap.set(path, chuck);
            }
          }
        });
      }
      this.selectedChucks = Array.from(this.selectedMap.values());
    },
  },
  methods: {
    getFont() {
      // font -> base64
      let font =
        "";
      return font;
    },
    getAlbumBackground(){
      return "data:image/jpeg;base64,"
    },
    generatePdf() {
      console.log("이미지 설정")
      let backgroundUrl = this.getAlbumBackground()
      let font = this.getFont();
      var doc = new jsPDF();
      doc.addFileToVFS("MaplestoryLight.ttf", font);
      doc.addFont("MaplestoryLight.ttf", "MaplestoryLight", "normal");
      doc.setFont("MaplestoryLight");
      doc.setFontSize(40);
      doc.text(this.$store.getters.getSelectedGroup.name + "의 Chuck", 40, 55);
      doc.setFontSize(20);
      doc.text(this.$moment(new Date()).format("YYYY년MM월DD일"), 120, 250);
      doc.text(this.$store.getters.getName, 120, 260);

      for (let index = 0; index < this.selectedChucks.length; index++) {
        doc.addPage();
        // 배경이미지
        // console.log("배경이미지 삽입")
        // console.log(backgroundUrl)
        doc.addImage(backgroundUrl,'JPEG', 15, 20, 180, 140);

        const element = this.selectedChucks[index];
        // console.log(element)
        
        // 이미지 설정
        let img = new Image();
        img.onload = () => {
          console.log(`the image dimensions are ${img.width}x${img.height}`)
        }
        img.src = element.image;

        // console.log(element.image);
        doc.addImage(element.image, 30, 35, 150, 100);
        doc.setFontSize(30);
        doc.text(element.title, 40, 180);
        doc.setFontSize(15);
        doc.text(element.writer, 40, 190);
        doc.text(element.content, 40, 200);
      }

      doc.save(this.$store.getters.getSelectedGroup.name + "'sChuck"+this.$moment(new Date()).format('MMDD')+".pdf");
    },
  },
};
</script>

